var img_per_page = 12;
var cur_page = 1;

function getImage(imageindex) {
    if (imageindex>-1 && imageindex<images.length) {
        return images[imageindex];
    }
    else return -1;
}

function AddImages(page) {
    var img_count = images_link.length;
    var pages;
    if (img_count < 12){
        pages = 1;
    }
    else{
        pages = img_count / 12;
    }
    var start = 13*(page-1);
    var end;
    if (img_count > (start + 12)) {
        end = (start + 12)
    }
    else {
        end=img_count;
        }
    var j=1;
    for (var i=start; i<end ; i++) {
        var cur_img = document.createElement("img");
        cur_img.src = images_link[i];
//        cur_img.setAttribute("height", "768");
//        cur_img.setAttribute("width", "1024");
//        cur_img.setAttribute("alt", "Flower");
        var id = "img"+ j;
        var elem = document.getElementById(id);
        elem.innerHTML = "";
        elem.appendChild(cur_img);
        j = j+1;
    }
    document.getElementById("page-number").innerHTML = '';
    document.getElementById("page-number").innerHTML = cur_page;
}
function StartEngin() {
    AddImages(cur_page);
}
function NextPage() {
    if (cur_page+1<=images_link.length/12){
        cur_page++;
        AddImages(cur_page);
        }

}
function BackPage() {
    if (cur_page-1>0 ){
        cur_page--;
        AddImages(cur_page);
     }

}

